import styled from "styled-components";
import { HiMenu } from "react-icons/hi";


export const HeaderStyled = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

export const MenuIcon = styled(HiMenu)`
fill: #333D4B;
width: 30px;
height: 15px;
`
